import React, { Component } from 'react';
import Contar_nubes from './Contar_nubes.png'
class imagenes_1 extends Component{
    render(){
        return (
            <img src={Contar_nubes} width="80%" height= "50%" />
       
        );
    }
}

export default imagenes_1;
